import React, {useEffect, useRef} from "react";

function SkyCanvas(props) {
    let b = [];
    for (let i = 0; i < 8; ++i)
        b[i] = new Image();
    b[0].src = "data:image/png;base64,";
    b[1].src = "data:image/png;base64,";
    b[2].src = "data:image/png;base64,";
    b[3].src = "data:image/png;base64,";
    b[4].src = "data:image/png;base64,";
    b[5].src = "data:image/png;base64,";
    b[6].src = "data:image/png;base64,";
    const canvasRef = useRef();

    useEffect(() => {

        let then = 0;
        const FPS = 7, ROTATIONFPS = 7;
        const fpsInterval = 1000 / FPS;
        const rotationFpsInterval = 1000 / ROTATIONFPS;

        function draw() {
            if (Date.now() - then < rotationFpsInterval) {
                requestAnimationFrame(draw);
                return;
            }

            width = 1.5 * canvasRef.current.clientWidth;
            height = 1.5 * canvasRef.current.clientHeight;
            canvas.width = width;
            canvas.height = height;
            let wh = Math.sqrt(width * width + height * height);
            //TODO: Replace with css
            ctx.translate(width / 2, height / 2);
            ctx.rotate(rotationCounter);
            ctx.translate(-width / 2, -height / 2);
            ctx.fillStyle = ctx.createPattern(b[counter], "repeat");

            ctx.fillRect(-(wh - width) / 2, -(wh - height) / 2, wh, wh);
            rotationCounter += Math.PI / (1 << 14);

            if (Date.now() - then < fpsInterval) {
                requestAnimationFrame(draw);
                return;
            }
            ++counter;
            counter %= 7;
            then = Date.now();
            requestAnimationFrame(draw);
        }

        let width = 0, height = 0;
        const canvas = canvasRef.current;
        const ctx = canvas.getContext('2d');
        let counter = 0, rotationCounter = 0;
        draw();
    })

    return (<canvas className={props.className} ref={canvasRef}
                    style={{...{backgroundColor: 'rgb(var(--oxfordblue)'}, ...props.style}}/>);
}

export default SkyCanvas;